Create test/Greeter.test.ts: import { expect } from 'chai';
import { Wallet, Provider } from 'zksync-ethers';
import * as hre from 'hardhat';
import { Deployer } from '@matterlabs/hardhat-zksync'; const RICH_PK = '0x7726827caac94a7f9e1b160f7ea819f172f7b6f9d2a97f992c38edeab82d4110'; describe('Greeter', function () { it('deploys and greets', async function () { const provider = Provider.getDefaultProvider(); const wallet = new Wallet(RICH_PK, provider); const deployer = new Deployer(hre, wallet); // compile & deploy const artifact = await deployer.loadArtifact('Greeter'); const greeter = await deployer.deploy(artifact, ['Hello, zkSync!']); // call and assert expect(await greeter.greet()).to.equal('Hello, zkSync!'); });
});
